const mdBody = document.querySelector('.markdown-body');
const readmeURL = 'https://raw.githubusercontent.com/fsegurai/codemirror-themes/refs/heads/main/README.md';
const mdRender = (md) => {
    if (mdBody) {
        // Render the markdown into the mdBody element
        mdBody.innerHTML = d.parse(md);
        // Target every pre element and then, insert the copy button
        insertCopyElement();
    }
};
const insertCopyElement = () => {
    document.querySelectorAll('pre').forEach(pre => {
        const button = document.createElement('button');
        button.className = 'copy-btn';
        button.textContent = 'Copy';
        button.setAttribute('data-clipboard-text', pre.textContent || '');
        button.addEventListener('click', () => {
            button.textContent = 'Copied!';
            setTimeout(() => {
                button.textContent = 'Copy';
            }, 2000);
        });
        pre.appendChild(button);
    });
    // Initialize ClipboardJS
    new ClipboardJS('.copy-btn');
};
document.addEventListener('DOMContentLoaded', () => {
    if (mdBody) {
        fetch(readmeURL)
            .then(response => response.text())
            .then(text => {
            mdRender(text);
        })
            .catch(error => {
            mdBody.innerHTML = `
          <p>Failed to load README.md</p>
          
          <p>${error}</p>
          `;
        });
    }
});
